    // console.log(movie)
    const { title, rating, price, genre, image } = movie;
    // var vals = image.data.data.toString('base64') 
    return ( 
        <div className="card-box col-lg-3 col-md-4">
            <img src={sampleIcon} alt="a"/>
            <span>1.3</span>
            <p>{title}</p>
            <small>{genre}</small>
        </div>
    );
}

export default MovieCard;
